// Enum to represent different GPU models
enum class GPUType {
    UNKNOWN,
    A100,
    RTX_3090,
    RTX_3080
};


// Function to determine the GPU type and select the corresponding array based on the GPU name.
// @param gpuName The name of the GPU as a string.
// @return A pair consisting of the GPUType enum and a pointer to the selected array.
inline std::pair< GPUType, std::vector<std::vector<int>>* >  GetGPUTypeAndArray(const std::string& gpuName) {
	std::vector<std::vector<int>>* selectedArray = nullptr;
	GPUType gpuModel = GPUType::UNKNOWN;

    if (gpuName.find("A100") != std::string::npos) {
        gpuModel = GPUType::A100;
        selectedArray = &array_A100;
    } else if (gpuName.find("RTX 3090") != std::string::npos) {
        gpuModel = GPUType::RTX_3090;
        selectedArray = &array_3090;
    } else if (gpuName.find("RTX 3080") != std::string::npos) {
        gpuModel = GPUType::RTX_3080;
        selectedArray = &array_3080;
    } else {
        //pass
    }
    return std::make_pair(gpuModel, selectedArray);
}


// Function to solve a quadratic equation and compute the row index for arrays corresponding to different GPUs.
// @param m The first dimension of the input matrix.
// @param n The second dimension of the input matrix.
// @return The complex root of the quadratic equation.
std::complex<double> solve_quadratic_equation(int m, int n) {
	const int a = 160 * 160;
	const int b = 2 * 64 * 160;

    double c = 64 * 64 - m * n;
    double discriminant = b * b - 4 * a * c;
    std::complex<double> root = (-b + std::sqrt(discriminant)) / (2 * a);
//          std::cout << "root" <<root1<< std::endl;
    return root;
}


// Function to calculate the row index in the array based on the input matrix size.
// Calculate the number of rows in the array according to the input matrix size m n
// @param device_type The type of GPU being used.
// @param m The first dimension of the input matrix.
// @param n The second dimension of the input matrix.
// @return The row index in the array.
inline int getArrayRowIndex(GPUType device_type, int m, int n) {
    int row = static_cast<int>(std::round(solve_quadratic_equation(m,n).real()));//rounding
    switch (device_type) {
        case GPUType::RTX_3080:
            return std::min(std::max(row, 0), 80);
        case GPUType::RTX_3090:
            return std::min(std::max(row, 0), 140);
        case GPUType::A100:
            return std::min(std::max(row, 0), 164);
        default:
            return -1; // Invalid GPU model
    }
}


// Calculate the number of cols in the array according to the input matrix size k
// Function to calculate the column index in the array based on the input matrix size.
// @param k The size parameter used to calculate the column index.
// @return The column index in the array.
inline int getArrayColIndex(int k) {
    return static_cast<int>(std::round(static_cast<double>(k) / 256.0)) - 1;
}


// Function to find the optimal kernel parameter within a given range based on the GPU type and matrix dimensions.
// @param device_id The CUDA device ID for the GPU.
// @param m The first dimension of the input matrix.
// @param n The second dimension of the input matrix.
// @param k The size parameter used in the calculation.
// @return The optimal kernel parameter if found, otherwise -1.

inline int find_best_kernel(int device_id, int m, int n, int k) {
	// get GPU type
	cudaDeviceProp device_props;
	cudaGetDeviceProperties(&device_props, device_id);
	std::pair<GPUType, std::vector<std::vector<int>>*> result = GetGPUTypeAndArray(device_props.name);
    GPUType gpuType = result.first;
    std::vector<std::vector<int>>* selectedArray = result.second;

    if (selectedArray == nullptr || gpuType == GPUType::UNKNOWN) {
        std::cerr << "Got error on selectedArray or unknow GPU type."  << std::endl;
        return -1;
    }

    int row = getArrayRowIndex(gpuType, m, n);
    int col = getArrayColIndex(k);

    if (row < 0 || col < 0) {
        std::cerr << "Got error while finding best cutlass kernel. Row: "<< row << "or Col: "<< col << std::endl;
        return -1;
    }

    // Get the value in the corresponding array
    int value_at_position = (*selectedArray)[row][col];
    if (value_at_position == 0) {
        std::cerr << "Failed to read the value for gpu_type." << std::endl;
        return -1;
    }

//    std::cout << "Read value_at_position " << value_at_position << std::endl;
    return value_at_position;
}

